export default (function(a,b,c,d,e,f,g,h,i){return {data:{L4C6pbeoNS:{data:{id:837,attributes:{imdbId:"tt3401392",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTI5ZWFhOTAtMTRlNC00ZTA3LTk4NTctZjhjMmM3Y2JiMDE3XkEyXkFqcGdeQXVyNzI1NjQ1MTU@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:1500,attributes:{title:a,plot:"A murder mystery that follows a cat-and-mouse relationship between a relentless detective and his equally clever former classmate who's protecting the guilty.",slug:"the-devotion-of-suspect-x"}}},books:{data:[{id:5172,attributes:{title:a,description:"Yasuko Hanaoka thought she had escaped her abusive ex-husband Togashi. When he shows up one day, the situation quickly escalates, and Togashi ends up dead. Yasuko's next-door-neighbor Ishigami offers his help, not only disposing of the body, but plotting the cover-up as well.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sWbZtgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2012-01-31",publisher:"Abacus Software",subtitle:c}},{id:5173,attributes:{title:"Devotion of Suspect X A Ind Loc",description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0WLhoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2012-02-02",publisher:"Orbit Books",subtitle:c}},{id:5174,attributes:{title:a,description:"Yasuko Hanaoka is a divorced, single mother who thought she had finally escaped her abusive ex-husband Togashi. When he shows up one day to extort money from her, threatening both her and her teenaged daughter Misato, the situation quickly escalates into violence and Togashi ends up dead on her apartment floor. Overhearing the commotion, Yasuko’s next door neighbor, middle-aged high school mathematics teacher Ishigami, offers his help, disposing not only of the body but plotting the cover-up step-by-step. When the body turns up and is identified, Detective Kusanagi draws the case and Yasuko comes under suspicion. Kusanagi is unable to find any obvious holes in Yasuko’s manufactured alibi and yet is still sure that there’s something wrong. Kusanagi brings in Dr. Manabu Yukawa, a physicist and college friend who frequently consults with the police. Yukawa, known to the police by the nickname Professor Galileo, went to college with Ishigami. After meeting up with him again, Yukawa is convinced that Ishigami had something to do with the murder. What ensues is a high level battle of wits, as Ishigami tries to protect Yasuko by outmaneuvering and outthinking Yukawa, who faces his most clever and determined opponent yet.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=huVwmAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:e,publisher:f,subtitle:c}},{id:5175,attributes:{title:a,description:g,thumbnail:h,authors:[b],firstBook:d,published:e,publisher:f,subtitle:i}},{id:5176,attributes:{title:a,description:g,thumbnail:h,authors:[b],firstBook:d,published:e,publisher:f,subtitle:i}}]}}},meta:{}}},prerenderedAt:1680940956189}}("The Devotion of Suspect X","Keigo Higashino","",null,"2011-02-01","Minotaur Books","This e-book now includes preview chapters from Higashino's newest mystery, SALVATION OF A SAINT. Yasuko Hanaoka is a divorced, single mother who thought she had finally escaped her abusive ex-husband Togashi. When he shows up one day to extort money from her, threatening both her and her teenaged daughter Misato, the situation quickly escalates into violence and Togashi ends up dead on her apartment floor. Overhearing the commotion, Yasuko's next door neighbor, middle-aged high school mathematics teacher Ishigami, offers his help, disposing not only of the body but plotting the cover-up step-by-step. When the body turns up and is identified, Detective Kusanagi draws the case and Yasuko comes under suspicion. Kusanagi is unable to find any obvious holes in Yasuko's manufactured alibi and yet is still sure that there's something wrong. Kusanagi brings in Dr. Manabu Yukawa, a physicist and college friend who frequently consults with the police. Yukawa, known to the police by the nickname Professor Galileo, went to college with Ishigami. After meeting up with him again, Yukawa is convinced that Ishigami had something to do with the murder. What ensues is a high level battle of wits, as Ishigami tries to protect Yasuko by outmaneuvering and outthinking Yukawa, who faces his most clever and determined opponent yet.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=nKmmmYk_a34C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","A Detective Galileo Novel"))